import React from 'react';
import { Route, Routes } from 'react-router-dom';
import Header from './components/Header'; // Assuming Header is the component you are working with

const App = () => {
  return (
    <div>
      <Header cartCount={5} /> {/* Pass cartCount prop to Header */}
      <Routes>
        <Route path="/" element={<Dashboard />} />
        <Route path="/cart" element={<Cart />} />
        <Route path="/signin" element={<SignIn />} />
        <Route path="/signup" element={<SignUp />} />
      </Routes>
    </div>
  );
};

export default App;
